import React from 'react';
import Layout from '../../components/shared/Layout/Layout'
import ContactForm from './ContactForm';


const Contact = () => {
  return (
    <div>
      <Layout>
        <h1>Contact Me </h1>
        <a href="mailto:bondconsulting@gmail.com">bondconsulting@gmail.com</a><br /><br />
        <a href="https://www.linkedin.com/in/jeffbond/">linkedIn/in/JeffBond</a><br /><br />
        <a href="Github.com/Techumseh">Github.com/Techumseh</a><br /><br />
        <a href="medium.com/@jeffreybond"> Medium.com/@jeffreybond</a>
        <a href="https://calendly.com/jeffrey-bond"> https://calendly.com/jeffrey-bond</a>

        <h4>Or send a message using the form below</h4>
      <form method="POST">
    <label htmlFor="name">Name:</label>
    <input type="text" name="name" /><br />

    <label htmlFor="email">Email:</label>
    <input type="email" name="email" /><br />

    <label htmlFor="message">Message</label><br />
    <textarea name="message" rows="3"></textarea><br />

    <input type="submit" />
  </form>
      </Layout>

    </div>
  );
};

export default Contact;
